import base64

# Your Base64 string (truncated for this example)
base64_string = "data:audio/wav;base64,"

# Remove the "data:audio/wav;base64," prefix if present
if base64_string.startswith("data:audio/wav;base64,"):
    base64_string = base64_string.replace("data:audio/wav;base64,", "")

# Decode the Base64 string
audio_data = base64.b64decode(base64_string)

# Write the binary data to a WAV file
with open("output.wav", "wb") as audio_file:
    audio_file.write(audio_data)

print("Audio file saved as 'output.wav'")
